    private final MaterialName name;
    private final MaterialWrapper handle;

    private Material(@NotNull final MaterialName name) {
        this.name = name;
        this.handle = new MaterialWrapper(name);
    }

    private Material() {
        this.name = null;
        this.handle = new MaterialWrapper();
    }

    @Override
    public int getId() {
        return handle.getId();
    }

    @Override
    public int getData() {
        return handle.getData();
    }

    @Nullable
    @Override
    public MaterialName getName() {
        return name;
    }

    @NotNull
    public MaterialWrapper getWrapper() {
        return handle;
    }

    @NotNull
    public static Material fromIdData(final int id, final int data) {
        return VALUES.stream()
                .filter(material -> material.getId() == id && material.getData() == data)
                .findAny().orElse(Material.UNKNOWN);
    }

    @NotNull
    public static Material fromName(@NotNull final String name) {
        return VALUES.stream()
                // material.getName can't return null here
                .filter(material -> Objects.requireNonNull(material.getName()).getName().equalsIgnoreCase(name))
                .findAny().orElse(Material.UNKNOWN);
    }
